import React from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";
// import {LogoHeader} from "../assets/Logo_Header";
const Nav = (props) => (
  <>
    <header>
      <div className="company-logo">LongDino</div>
      <nav className="navbar">
        <ul className="nav-items">
          <li className="nav-item">
            <a href="www.google.com" className="nav-link">
              <Link to="/Home">HOME</Link>
            </a>
          </li>
          <li className="nav-item">
            <a
              href="https://api.whatsapp.com/send?phone=+56936681029&text=Hola, Quisiera hacer unas consultas."
              target="_blank"
              rel="noreferrer"
              className="nav-link"
            >
              <Link to="/Contact">CONTACT</Link>
            </a>
          </li>
        </ul>
      </nav>
      <div className="menu-toggle">
        <i className="bx bx-menu"></i>
        <i className="bx bx-x"></i>
      </div>
    </header>
    <div className="linetop"></div>
  </>
);

function Navbar() {
  /* eslint-disable */
  return <Router></Router>;
}

export default Navbar;
